      | 356918 -> { ItemTypeData.id= 356918; name= "'Eclipse' Active Scanner"; published= false; description= "Sending out a triggered pulse of high-frequency magnetometric waves and interpreting the results with an uplinked onboard computer, the Active Scanner gives ground units a snapshot of enemy positions. Projection nodes set at specific angles on the hand-held device, generate a vectored impulse capable of extracting objects from high-noise environments. Feedback from the pulse is filtered to reduce ambient clutter and pinpoint targets lacking IFF signals.  Though the amount of energy required to produce the blast is much greater than its on-board power source can readily generate, the Active Scanner makes use of redundant J-24 micro-capacitors to circulate and build the charge up to the required output. The resulting delay between activations is a small price to pay for the enormous tactical advantage the device provides its user."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 35945 -> { ItemTypeData.id= 35945; name= "Standup Weapon Disruptor I"; published= true; description= "The Standup Weapon Disruptor is an electronic warfare system designed to reduce the range and tracking speed of turrets and reduces range and precision of missiles on targeted ships. The Weapon Disruptor system can be installed as a module in Upwell technology structures.    Standup is a proprietary system that uses a Structure Autonomous Nanoassembly Device (Upwell) containing integrated template software, a nanoassembler array and sufficient nanomass to enable the construction of a variety of service modules, structure modules and structure rigs when inserted into the appropriate slots on a structure built with Upwell technology.    Penalty: Using more than one type of this module or similar modules that affect the same attribute on the ship will be penalized."; marketGroupId= Some(2215); groupId= 1719; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 4; value= 500.000000 }; { DogmaAttributeValueData.attributeId = 6; value= 400.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 40.000000 }; { DogmaAttributeValueData.attributeId = 1298; value= 1657.000000 }; { DogmaAttributeValueData.attributeId = 1299; value= 1404.000000 }; { DogmaAttributeValueData.attributeId = 1300; value= 1406.000000 }; { DogmaAttributeValueData.attributeId = 2334; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 4000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 547; value= -37.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 50; value= 1500.000000 }; { DogmaAttributeValueData.attributeId = 30; value= 50000.000000 }; { DogmaAttributeValueData.attributeId = 54; value= 150000.000000 }; { DogmaAttributeValueData.attributeId = 73; value= 5000.000000 }; { DogmaAttributeValueData.attributeId = 847; value= -50.000000 }; 